    true,nt"url": null,nt"notes": "<p>The Medicare-Medicaid Coordination Office
    (MMCO) is releasing an analysis of trends in Medicare-Medicaid enrollee population
    and demographic characteristics from 2006 through 2011. This builds on the Medicare-Medicaid
    Enrollee State Profiles we issued in 2012, which provided an overview of this populations
    demographic characteristics as well as utilization, cost, chronic conditions and
    the programs that serve them in each state. In this report, MMCO counted the number
    of beneficiaries who were ever-enrolled in both Medicare and Medicaid (Medicare-Medicaid
    enrollees, also known as dual eligible beneficiaries) for one or more months over
    the course of each calendar year. This report focuses only on eligibility and enrollment
    numbers and as a result is based off of much more recent data.</p>n",nt"license_title":
